import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './SalaryTable.css';

const SalaryTable = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);

  useEffect(() => {
    const fetchSalaries = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/salaries`, {
          params: { contractId, month, year }
        });
        setSalaries(response.data);
      } catch (error) {
        console.error('Error fetching salaries:', error);
      }
    };

    fetchSalaries();
  }, [contractId, month, year]);

  const calculateTotals = () => {
    const totals = salaries.reduce((acc, salary) => {
      acc.grossSalary += salary.grossSalary;
      acc.employeeEPF += salary.employeeEPF;
      acc.employeeESIC += salary.employeeESIC;
      acc.pTax += salary.pTax;
      acc.totalDeductions += salary.totalDeductions;
      acc.netSalary += salary.netSalary;
      acc.employerEPF += salary.employerEPF;
      acc.employerESIC += salary.employerESIC;
      acc.adminCharges += salary.adminCharges;
      acc.contribution += salary.contribution;
      return acc;
    }, {
      grossSalary: 0,
      employeeEPF: 0,
      employeeESIC: 0,
      pTax: 0,
      totalDeductions: 0,
      netSalary: 0,
      employerEPF: 0,
      employerESIC: 0,
      adminCharges: 0,
      contribution: 0,
    });

    return totals;
  };

  const totals = calculateTotals();

  return (
    <div className="salary-table">
      <h2>Salary Details</h2>
      <table>
        <thead>
          <tr>
            <th>Employee Name</th>
            <th>Attendance</th>
            <th>Daily Wage</th>
            <th>Gross Salary</th>
            <th>Employee EPF</th>
            <th>Employee ESIC</th>
            <th>P Tax</th>
            <th>Total Deductions</th>
            <th>Net Salary</th>
            <th>Employer EPF</th>
            <th>Employer ESIC</th>
            <th>Admin Charges</th>
            <th>Contribution</th>
          </tr>
        </thead>
        <tbody>
          {salaries.map((salary) => (
            <tr key={salary.employeeId._id}>
              <td>{salary.employeeId.name}</td>
              <td>{salary.attendance}</td>
              <td>{salary.dailyWage}</td>
              <td>{salary.grossSalary.toFixed(2)}</td>
              <td>{salary.employeeEPF.toFixed(2)}</td>
              <td>{salary.employeeESIC.toFixed(2)}</td>
              <td>{salary.pTax.toFixed(2)}</td>
              <td>{salary.totalDeductions.toFixed(2)}</td>
              <td>{salary.netSalary.toFixed(2)}</td>
              <td>{salary.employerEPF.toFixed(2)}</td>
              <td>{salary.employerESIC.toFixed(2)}</td>
              <td>{salary.adminCharges.toFixed(2)}</td>
              <td>{salary.contribution.toFixed(2)}</td>
            </tr>
          ))}
          <tr className="totals">
            <td><strong>Totals</strong></td>
            <td colSpan="3"></td>
            <td><strong>{totals.grossSalary.toFixed(2)}</strong></td>
            <td><strong>{totals.employeeEPF.toFixed(2)}</strong></td>
            <td><strong>{totals.employeeESIC.toFixed(2)}</strong></td>
            <td><strong>{totals.pTax.toFixed(2)}</strong></td>
            <td><strong>{totals.totalDeductions.toFixed(2)}</strong></td>
            <td><strong>{totals.netSalary.toFixed(2)}</strong></td>
            <td><strong>{totals.employerEPF.toFixed(2)}</strong></td>
            <td><strong>{totals.employerESIC.toFixed(2)}</strong></td>
            <td><strong>{totals.adminCharges.toFixed(2)}</strong></td>
            <td><strong>{totals.contribution.toFixed(2)}</strong></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default SalaryTable;
